import {Component, EventEmitter, Input, OnInit, Output} from '@angular/core';
import {Product} from "../../../services/product/product.service";

@Component({
  selector: 'app-product-list-node',
  templateUrl: './product-list-node.component.html',
  styleUrls: ['./product-list-node.component.css']
})
export class ProductListNodeComponent implements OnInit {

  @Input()
  public product : Product;

  @Output()
  deleteAction : EventEmitter<any> = new EventEmitter();

  constructor() { }

  ngOnInit() {
    this.product.image = '';
  }

  private deleteProduct() {
    this.deleteAction.emit(null);
  }
}
